import React from "react";
import "./style.css"

const FeaturesView = () =>{
    return(
        <section className="FeaturesView">
            <div className="container topContainer">
                <div className="top">
                    <div className="text">
                        <h1> The future will develop gradually, please be patient and look forward to your attention</h1>
                    </div>
                </div>
            </div>
        </section>
    )
}
export default FeaturesView;
